import React from 'react';
import{
	BrowserRouter as Router,
	Route,
	Link
}from 'react-router-dom';


function Header() {
  return (
<header>
<div className="logo">
Logo
</div>

<nav>
<ul>
<li>
<a href="#Home">Home</a>
</li>
<li>
<a href="/Blog">Blog</a>
</li>
</ul>
</nav>
</header>
  );
}

export default Header;
